export const ClientsSection = () => {
  return (
    <section className="absolute top-[4136px] left-[122px] w-[586px] h-[472px] flex flex-col">
      <h2 className="-ml-1 h-[49px] w-[582px] self-center font-extrabold text-[75px] tracking-[0] leading-[43px] whitespace-nowrap flex items-center justify-center text-black">
        Our Clients
      </h2>

      <div className="w-[582px] h-[3px] mt-[49px] bg-gray-300" />

      <p className="flex items-center justify-center w-[582px] h-[319px] mt-[52px] font-normal text-[#3d3d3d] text-[25px] tracking-[0] leading-10">
        We are proud to partner with leading organizations across the power, oil
        & gas, and process industries. Our clients trust us for reliable
        auxiliary systems, engineering precision, and long-term operational
        performance. With thousands of installations in service, our solutions
        continue to support critical operations in India and across global
        markets.
      </p>
    </section>
  );
};
